    private static char kthHigh(char[] charArray, int k) {
        return kthHigh(charArray, k, 0, charArray.length - 1);
    }

    private static char kthHigh(char[] charArray, int k, int start, int end) {
        // 首位作为比较
        char comppare = charArray[start];
        // 从次卫到末尾，左右分割，小的左，大的右
        int lo = start;
        int high = end;
        while (true) {
            while (charArray[lo] <= comppare && lo < end) lo++;
            while (charArray[high] > comppare && high > start) high--;
            if (lo >= high) break;
            exchange(charArray, lo, high);
        }
        exchange(charArray, start, high);
        // 已经分左右了，kth大的看当前分割的位置，如果正好是 length - k 个数，就返回，否则继续找左或右半边即可
        if (high > charArray.length - k) {
            // 继续从左边找
            return kthHigh(charArray, k, start, high - 1);
        } else if (high < charArray.length - k) {
            // 从右边找
            return kthHigh(charArray, k, high + 1, end);
        } else {
            return charArray[high];
        }
    }

